import {motion } from "motion/react"
import { HomeSelection } from "../components/HomeSelection"

export const Landing = ()=>{
    return(
        <>
            <div className="w-screen h-screen flex flex-col ">
                <div className="w-[100vw] flex justify-center border-b border-black border-opacity-20 ">
                    <div className=" w-[80vw] flex justify-between py-6  ">
                        <h1 className="font-manrope font-extrabold text-[#FF7518] text-3xl  tracking-tighter ">TravO</h1>
                    </div>
                 </div>

                    <motion.div initial={{ opacity: 0, y: -20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{
                  duration: 0.3,
                  ease: "easeInOut",
                }}
                     className="w-screen flex justify-center mt-20 ">
                    <div className="w-[80vw]">
                    <div className="flex flex-col gap-4  ">
                        <h1 className=" font-manrope text-[#FF7518] tracking-tighter text-4xl md:text-6xl font-extrabold">Find places to stay on TravO</h1>
 
                        <h1 className="font-manrope text-[#FF7518] tracking-tighter text-xl md:text-2xl font-extrabold opacity-70">Discover entire homes and rooms perfect for any trip.</h1>
                    
                    </div>
                    <HomeSelection/>



                </div>
                    </motion.div>

            </div>
        </>
    )
}
